import React from 'react';

const Login = () => {
  return (
    <>
      <div className='form-usuario'>
        <div className='contenedor-form sombra-dark'>
          <form>
            <div className='compo-form'>
              <label htmlFor='email'>
                <input type='email' id='email' />
              </label>
            </div>
          </form>
        </div>
      </div>
    </>
  );
};

export default Login;
